import { Link } from "react-router-dom";

export default function MainNavigation() {
  return (
    <header>
      <nav>
        <ul>
          <Link to="/">homepage</Link>
          <Link to="/products">products page</Link>
        </ul>
      </nav>
    </header>
  );
}
